import React, { Component } from 'react';
import Navigationbar from '../navigation';
import '@fortawesome/fontawesome-free/css/all.min.css';
import PropTypes from 'prop-types';
import profilepic from './../images/download.png'
// import { connect } from 'react-redux';
// import { customerSignup } from '../../actions/signupActions'
import { Redirect } from 'react-router';
import { Link } from 'react-router-dom';
import { UserProfileNavBar, UserProfileJumbo, NavList, Form, Button, MDBInput, Carousel} from 'react-bootstrap';
import rest1 from './../images/rest1.jpg'
import rest2 from './../images/rest2.jpg'
import food1 from './../images/food1.jpg'
import food2 from './../images/food2.jpg'
import axios from 'axios';


class RestaurantPage extends Component {
    state = {};
    render() {
      return (
        <React.Fragment>
          <Navigationbar />
            <div class="top-content">
                <div class="container-fluid">
                    <div class="row">
                        <div class="col-xs-12">
                            <div id="carousel-example" class="carousel slide" data-interval="2000" data-ride="carousel" data-pause="hover" data-wrap="true">
                                <ol class="carousel-indicators">
                                    <li data-target="#imageCarousel"data-slide-to="0" class="active"></li>
                                    <li data-target="#imageCarousel"data-slide-to="1"></li>
                                    <li data-target="#imageCarousel"data-slide-to="2"></li>
                                </ol>

                                <div class="carousel-inner">
                                    <div class=" item active">
                                        <div class="row">
                                            <div class="col-xs-4">
                                                <img src={rest1} class="img-responsive"/>
                                            </div>
                                            <div class="col-xs-4">
                                                <img src={rest2} class="img-responsive"/>
                                            </div>
                                            <div class="col-xs-4">
                                                <imf src={food1} class="img-responsive"/>
                                            </div>
                                        </div>
                                    </div>
                                </div>


                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </React.Fragment>
      );
    }
  }

  export default RestaurantPage;
